keywords.doc:
Creates and returns a dictionary from the given key\_value\_pairs.

Examples:

```
${x} =  Create Dictionary  name  value    
${y} =  Create Dictionary  a  1  b  2
${z} =  Create Dictionary  a  ${1}  b  ${2}
```

\=>

*   ${x} = {'name': 'value'}
*   ${y} = {'a': '1', 'b': '2'}
*   ${z} = {'a': 1, 'b': 2}
